import React from 'react';
import axios from 'axios';
import qs from 'qs';

export class App extends React.Component {
	constructor() {
		super();
		this.state = {
			sent: true,
			val1: null,
			val2: null,
			val3: null,
		};
	}
	render() {
		return (this.state.sent ? this.servicesForm() : this.b());
	}
	submit(e) {
		/*e.preventDefault();
		console.log("submit2")
		const data = [this.state.val1, this.state.val2, this.state.val3];
		console.log(data)
