	servicesForm() {
		const restaurants = [{
			name: "Pizza Hut",
			fee: "$0.50",
			miles: 2,
		},
		{
			name: "Taco Bell",
			fee: "$0.80",
			miles: 7,
		}];
		return (<>
		{
			restaurants.map(function (data) {
				return (
					<button onClick={(e) => this.setState({ sent: false })}>
					<div>
						<h6>{data.name}</h6>
						<br />
						<small>{data.fee} Delivery Fee</small>
						<br />
						<small>{data.miles} Miles</small>
					</div>
				</button>);
			})

		}
		</>);
	}
	b() {
		return <div>Service request submitted.</div>;
	}
}
export default App;
